区分：栄養機能食品<BR><BR>ハマダコンフェクト 骨にカルシウムウエハース 40枚×10個セット<br><br>リニューアルに伴い、パッケージ・内容等予告なく変更する場合がございます。予めご了承ください。<br><br />子供から大人まで幅広い年齢層で人気の栄養機能＆健康サポートウエハースです。<br />美容や健康が気になる方に好評の商品です。<br /><br />サクッとおいしく不足しがちな栄養素を毎日手軽に補給できます。 <br /><br />北海道産牛乳を使用したバニラ味のウエハースです。<br />小麦全粒粉入り。<br /><br />1枚当たりカルシウム300mg＆ビタミンＤ1.5μg配合<br /><br />原材料名<br />小麦粉、植物油脂、ブドウ糖、乳糖、粉糖、脱脂粉乳、牛乳、砂糖、卵、小麦全粒粉、食塩、卵殻Ｃａ、乳化剤、膨張剤、香料、ビタミンＤ<br /><br />標準栄養成分表　1枚（標準7.1g）当たり<br />エネルギー：32kcal<br />ナトリウム：9mg<br />たんぱく質：0.4g<br />カルシウム：300mg<br />脂質：1.5g<br />ビタミンＤ：1.5μg<br />炭水化物：4.4g<br /><br />味：バニラ<br /><br />内容量：40枚入り<br /><br />希望小売価格：１個630円(税別) <br /><br />賞味期間：製造日から1年<br /><br />商品サイズ：310×215×40mm<br /><br />JANコード：4902621003438<br><br><br>（駄菓子　うえはーす　カルシウム　骨　健康　成長　栄養　お子様　おやつ）<br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
